     &             1/3.D0*Re(B00(0.D0,MSf2(Sfe3,3,Gen3),
     &                MSf2(Sfe3,3,Gen3))))*
     &           (3*USf2(Sfe3,1,3,Gen3) - 
     &             4*SW2*(USf2(Sfe3,1,3,Gen3) + 
     &                USf2(Sfe3,2,3,Gen3))) + 
     &          (1/12.D0*Re(A0(MSf2(Sfe3,bTR,Gen3))) - 
     &             1/6.D0*Re(B00(0.D0,MSf2(Sfe3,bTR,Gen3),
     &                MSf2(Sfe3,bTR,Gen3))))*
     &           (3*USf2(Sfe3,1,bTR,Gen3) - 
     &             2*SW2*(USf2(Sfe3,1,bTR,Gen3) + 
     &                USf2(Sfe3,2,bTR,Gen3)))))/(CW*MZ2*SW)

	ENDLOOP(Gen3)
	ENDLOOP(Sfe3)

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dZZA1 =", dZZA1 ENDL
#endif

	dMh0A0sq1 = -(1/2.D0*(dTA01*EL0*SBA)/(CW*MZ*SW))

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dMh0A0sq1 =", dMh0A0sq1 ENDL
#endif

	dMHHA0sq1 = -(1/2.D0*(CBA*dTA01*EL0)/(CW*MZ*SW))

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dMHHA0sq1 =", dMHHA0sq1 ENDL
#endif

	dMHHG0sq1 = dMh0A0sq1

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dMHHG0sq1 =", dMHHG0sq1 ENDL
#endif

	dTB1 = 1/2.D0*(dZh0h01 - dZHHHH1)/C2A

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dTB1 =", dTB1 ENDL
#endif

	dZA0G01 = 1/2.D0*((dZh0h01 - dZHHHH1)*S2B)/C2A

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dZA0G01 =", dZA0G01 ENDL
#endif

	dZe1 = -(1/2.D0*(CW*(dZAA1heavy + dZAA1light) - dZZA1*SW)/CW)

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dZe1 =", dZe1 ENDL
#endif

	dZh0HH1 = 1/2.D0*((dZh0h01 - dZHHHH1)*S2A)/C2A

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dZh0HH1 =", dZh0HH1 ENDL
#endif

        dMA0G0sq1 = -(1/2.D0*
     &      (EL0*(CBA*dTh01 - dTHH1*SBA) + CW*dTB1*MA02*MZ*S2B*SW)/
     &       (CW*MZ*SW))

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dMA0G0sq1 =", dMA0G0sq1 ENDL
#endif

	dMh0G0sq1 = -dMHHA0sq1

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dMh0G0sq1 =", dMh0G0sq1 ENDL
#endif

	end
